"2085":{"id":"2085","name":"Romeu Tem Que Morrer","slug":"romeu-tem-que-morrer","original_title":"Romeo Must Die","overview":"O submundo do crime gerou uma verdadeira guerra em São Francisco, pois a máfia chinesa, comandada por Ch'u Sing (Henry O), disputa o controle do porto com o grupo chefiado pelo afro-americano Isaak O'Day (Delroy Lindo). Em Hong Kong, o ex-policial Han Sing (Jet Li), filho de Ch'u, foi injustamente acusado e cumpre pena, pois assim permitiu que seu pai, um chefão chinês do crime, e seu irmão fugissem para São Francisco. Ao saber que seu irmão foi morto, ele escapa da prisão e vai para os Estados Unidos atrás do assassino. Hostilizado pela própria família e alvo da gangue inimiga, Han encontra apoio em Trish O'Day, justamente a filha de Isaak, mas muita coisa está em jogo. E Han terá de usar todo seu conhecimento das artes marciais para sair vivo.","first_air_date":"2000-03-22","runtime":115,"episode_run_time":[115],"vote_average":6.3,"created_by":["Silver Pictures","Warner Bros. Pictures"],"production_companies":[{"name":"Silver Pictures"},{"name":"Warner Bros. Pictures"}],"cast":["Jet Li","Aaliyah","Isaiah Washington","Russell Wong","DMX"],"backdrop_path":"https://image.tmdb.org/t/p/original/fwP2w0TAwwSxiCk4s6agDGFoKNm.jpg","poster_path":"https://image.tmdb.org/t/p/original/wwCuBA58NukJIqx81sD785RGh0i.jpg","certification":"16","genres":["Ação","Crime","Thriller"],"trailer":"N/A"},
