"59":{"id":"59","name":"Marcas da Violência","slug":"marcas-da-violencia","original_title":"A History of Violence","overview":"Tom Stall leva uma vida tranquila e feliz na pequena cidade de Millbrook, no estado de Indiana, onde mora com sua esposa Edie e seus dois filhos. Um dia esta rotina de calmaria é interrompida quando Tom consegue impedir um assalto em seu restaurante. Percebendo o perigo, Tom se antecipa e consegue salvar seus clientes e amigos e, em legítima defesa, mata dois criminosos. Considerado um herói, Tom tem sua vida inteiramente transformada a partir de então. A mídia passa a segui-lo, o que o obriga a falar com ela regularmente e faz com que ele deseje que sua vida retorne à calmaria anterior. Surge então em sua vida Carl Fogarty, um misterioso homem que acredita que Tom lhe fez mal no passado.","first_air_date":"2005-09-23","runtime":96,"episode_run_time":[96],"vote_average":7.2,"created_by":["New Line Cinema","BenderSpink","Media I! Filmproduktion München & Company"],"production_companies":[{"name":"New Line Cinema"},{"name":"BenderSpink"},{"name":"Media I! Filmproduktion München & Company"}],"cast":["Viggo Mortensen","Maria Bello","Ed Harris","William Hurt","Ashton Holmes"],"backdrop_path":"https://image.tmdb.org/t/p/original/b6zLmqCKUFBqrc9zmMVT50YWhjK.jpg","poster_path":"https://image.tmdb.org/t/p/original/38Ov2S2Onb77xIA00diPh3R3GrW.jpg","certification":"18","genres":["Drama","Thriller","Crime"],"trailer":"N/A"},
"12118":{"id":"12118","name":"Loucademia de Polícia 3: De Volta ao Treinamento","slug":"loucademia-de-policia-3-de-volta-ao-treinamento","original_title":"Police Academy 3: Back in Training","overview":"A cidade tem duas academias de polícia, uma está sob o comando de Eric Lassard e a outra de Mauser. Este último soube que o estado, por falta de verbas, fechará uma das duas. Para se proteger, fala com Kyle Banks e Chad Copeland e os suborna, para que ter certeza que os cadetes de Lassard fracassarão. Lassard, por sua vez, chama seus formandos prediletos: Mahoney, Hightower, Jones, Tackleberry e Hooks que, junto Callahan, tentam treinar os cadetes na esperança de salvar a Academia.","first_air_date":"1986-03-20","runtime":84,"episode_run_time":[84],"vote_average":5.8,"created_by":["Police Academy Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Police Academy Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Steve Guttenberg","Bubba Smith","David Graf","Michael Winslow","Marion Ramsey"],"backdrop_path":"https://image.tmdb.org/t/p/original/zIp8rPr0UzL2QhB5JCU04DqPeHQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/rw0w3a6Ql2kngXRdFNvdgAbfiql.jpg","certification":"12","genres":["Comédia","Crime"],"trailer":"N/A"},
"9285":{"id":"9285","name":"Caindo na Estrada","slug":"caindo-na-estrada","original_title":"Road Trip","overview":"Josh (Breckin Meyer) está em sérios apuros. Uma fita de vídeo que mostra Josh traindo sua namorada foi enviada, por engano, para sua namorada. Agora Josh e mais três amigos precisam partir numa louca viagem, de Nova York até Austin, no Texas, a fim de recuperar a comprometedora fita de vídeo e salvar seu relacionamento.","first_air_date":"2000-05-19","runtime":94,"episode_run_time":[94],"vote_average":6.2,"created_by":["DreamWorks Pictures","The Montecito Picture Company"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"The Montecito Picture Company"}],"cast":["Breckin Meyer","Seann William Scott","Amy Smart","DJ Qualls","Paulo Costanzo"],"backdrop_path":"https://image.tmdb.org/t/p/original/mnHDUx3tS6Ps69vYfTuy4MaY8sg.jpg","poster_path":"https://image.tmdb.org/t/p/original/2iMiXw4hUL0UqvfXLxPPLptz94X.jpg","certification":"N/A","genres":["Comédia","Aventura"],"trailer":"N/A"},
"71":{"id":"71","name":"Billy Elliot","slug":"billy-elliot","original_title":"Billy Elliot","overview":"Billy Elliot é um garoto de 11 anos que vive numa pequena cidade da Inglaterra, onde o principal meio de sustento são as minas da cidade. Obrigado pelo pai a treinar boxe, Billy fica fascinado com a magia do balé, ao qual tem contato através de aulas de dança clássica que são realizadas na mesma academia onde pratica boxe. Incentivado pela professora de balé, que vê em Billy um talento nato para a dança, ele resolve então pendurar as luvas de boxe e se dedicar de corpo e alma à dança, mesmo tendo que enfrentar a contrariedade de seu irmão e seu pai à sua nova atividade.","first_air_date":"2000-09-28","runtime":110,"episode_run_time":[110],"vote_average":7.6,"created_by":["StudioCanal","BBC Film","Tiger Aspect","Arts Council of England","Working Title Films","Universal Pictures","WT² Productions"],"production_companies":[{"name":"StudioCanal"},{"name":"BBC Film"},{"name":"Tiger Aspect"},{"name":"Arts Council of England"},{"name":"Working Title Films"},{"name":"Universal Pictures"},{"name":"WT² Productions"}],"cast":["Jamie Bell","Gary Lewis","Julie Walters","Jean Heywood","Jamie Draven"],"backdrop_path":"https://image.tmdb.org/t/p/original/urzflyf41uySpgciGHdQzpcaMOY.jpg","poster_path":"https://image.tmdb.org/t/p/original/nOr5diUZxphmAD3li9aiILyI28F.jpg","certification":"12","genres":["Drama","Comédia","Música"],"trailer":"0g1YvKDdIfc"},
