"10428":{"id":"10428","name":"Hackers - Piratas de Computador","slug":"hackers-piratas-de-computador","original_title":"Hackers","overview":"Um adolescente conhecido como Zero Cool é uma lenda entre os hackers, pois com apenas 11 anos ele inutilizou 1507 computadores em Wall Street, provocando um caos total no mundo das finanças. Por conta deste ato ele ficou proibido de mexer em um computador até chegar aos 18 anos, mas quando pode retorna aos computadores utilizando agora o codinome Crash Override. Até que se depara com um gigantesco plano que, além de tornar o autor muito rico, pode incriminá-lo. Assim, com a ajuda de seus companheiros, ele tenta salvar sua pele.","first_air_date":"1995-09-14","runtime":107,"episode_run_time":[107],"vote_average":6.4,"created_by":["Suftley","United Artists","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Suftley"},{"name":"United Artists"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Jonny Lee Miller","Angelina Jolie","Matthew Lillard","Jesse Bradford","Renoly Santiago"],"backdrop_path":"https://image.tmdb.org/t/p/original/r7fk4I68wiGrhaExjtvnGtCAI1l.jpg","poster_path":"https://image.tmdb.org/t/p/original/mIlCgd51B5Ssms0Q95FjPPQqM7P.jpg","certification":"L","genres":["Ação","Crime","Thriller","Drama"],"trailer":"N/A"},
