"8469":{"id":"8469","name":"Clube dos Cafajestes","slug":"clube-dos-cafajestes","original_title":"Animal House","overview":"1962. Larry Kroger (Tom Hulce) e Kent Dorfman (Stephen Furst) são calouros na faculdade e sonham em entrar para uma fraternidade. Após não conseguirem entrar para a Omega eles resolvem tentar a Delta, que tem a fama de ser a pior fraternidade do campus. Lá eles conhecem Eric (Tim Matheson), Boone (Peter Reigert) e sua namorada Katy (Karen Allen), Hoover (James Widdoes) e Bluto (John Belushi). Larry e Kent logo são aceitos na fraternidade e passam a viver uma vida regada a viagens, piadas e festas de pijama. Só que Dean Wormer (John Vernon) está decidido a expulsar a Delta do campus da faculdade, contando com a ajuda dos integrantes da Omega.","first_air_date":"1978-07-28","runtime":109,"episode_run_time":[109],"vote_average":7.0,"created_by":["Universal Pictures","Oregon Film Factory","Stage III Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Oregon Film Factory"},{"name":"Stage III Productions"}],"cast":["John Belushi","Karen Allen","Tom Hulce","Stephen Furst","Mark Metcalf"],"backdrop_path":"https://image.tmdb.org/t/p/original/dBTWOjGU7ry4jGgP9fp63FZs83y.jpg","poster_path":"https://image.tmdb.org/t/p/original/37RHvunfP3uZBujIt8kw1yntejZ.jpg","certification":"14","genres":["Comédia"],"trailer":"N/A"},
"1251":{"id":"1251","name":"Cartas de Iwo Jima","slug":"cartas-de-iwo-jima","original_title":"Letters from Iwo Jima","overview":"Cartas há muito tempo enterradas em uma ilha revelam as histórias dos soldados japoneses que lutaram e morreram durante a Segunda Guerra Mundial. Entre eles estão Saigo, Baron Nishi e Shimizu. Embora o tenente-general Tadamichi Kuribayashi sabe que ele e seus homens têm virtualmente nenhuma chance de sobrevivência, ele usa suas extraordinárias habilidades militares para deter as tropas americanas pelo maior tempo possível.","first_air_date":"2006-12-09","runtime":141,"episode_run_time":[141],"vote_average":7.5,"created_by":["Warner Bros. Pictures","DreamWorks Pictures","Malpaso Productions","Amblin Entertainment"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"DreamWorks Pictures"},{"name":"Malpaso Productions"},{"name":"Amblin Entertainment"}],"cast":["Ken Watanabe","Kazunari Ninomiya","Tsuyoshi Ihara","Ryo Kase","Shido Nakamura"],"backdrop_path":"https://image.tmdb.org/t/p/original/p9V3vD1Ye2zRNfTsE8oY58Fe81S.jpg","poster_path":"https://image.tmdb.org/t/p/original/bePSUYRqxtQrLNGdx3E3BFxqiHT.jpg","certification":"14","genres":["Ação","Drama","Guerra"],"trailer":"N/A"},
