"133805":{"id":"133805","name":"Carrie: A Estranha","slug":"carrie-a-estranha","original_title":"Carrie","overview":"A doce e tímida colegial marginalizada Carrie White guarda um segredo chocante: quando está brava, ela pode mover objetos com a mente. Após ter sido perseguida impiedosamente por suas colegas de classe e maltratada pela mãe fanática religiosa, a ira de Carrie e seus poderes telecinéticos ficam descontrolados. E quando lhe pregam uma peça terrível no baile de formatura, os eventos saem de controle até o final aterrorizante desta ágil e intimidante história de horror.","first_air_date":"2013-10-16","runtime":99,"episode_run_time":[99],"vote_average":6.0,"created_by":["Misher Films","Screen Gems","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Misher Films"},{"name":"Screen Gems"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Chloë Grace Moretz","Julianne Moore","Gabriella Wilde","Ansel Elgort","Alex Russell"],"backdrop_path":"https://image.tmdb.org/t/p/original/gGl3zwoIal0Yn7qgrUgxzJIEVhV.jpg","poster_path":"https://image.tmdb.org/t/p/original/f60bJjQ6FUfxr0msrA1aMrwa9aV.jpg","certification":"16","genres":["Drama","Terror"],"trailer":"N/A"},
