"13515":{"id":"13515","name":"Espelhos do Medo","slug":"espelhos-do-medo","original_title":"Mirrors","overview":"Ben Carson (Kiefer Sutherland) é um ex-detetive que, há um ano, foi suspenso do Departamento de Polícia de Nova York por ter atingido com um tiro um policial infiltrado. O caso fez com que se tornasse alcóolatra, o que o afastou de sua esposa e filhos. Tentando retomar sua vida em família, Ben aceita o emprego de vigia noturno nas ruínas de uma loja de departamentos. Porém enquanto patrulha o local ele começa a notar algo estranho nos espelhos usados como enfeite, já que refletem imagens horripilantes.","first_air_date":"2008-08-15","runtime":111,"episode_run_time":[111],"vote_average":6.3,"created_by":["Regency Enterprises","New Regency Pictures","Luna Pictures","ASAF","Castel Film"],"production_companies":[{"name":"Regency Enterprises"},{"name":"New Regency Pictures"},{"name":"Luna Pictures"},{"name":"ASAF"},{"name":"Castel Film"}],"cast":["Kiefer Sutherland","Paula Patton","Amy Smart","Jason Flemyng","Cameron Boyce"],"backdrop_path":"https://image.tmdb.org/t/p/original/9zMbyilain3lcbX16fZwEkIBMLB.jpg","poster_path":"https://image.tmdb.org/t/p/original/1hnjHdVSsfnblSK1Q40cHpEumUa.jpg","certification":"N/A","genres":["Terror","Mistério"],"trailer":"ktbIyLgObnY"},
