"121856":{"id":"121856","name":"Assassin's Creed","slug":"assassin-s-creed","original_title":"Assassin's Creed","overview":"Por meio de uma tecnologia revolucionária que destrava suas memórias genéticas, Callum Lynch experimenta as aventuras de seu ancestral, Aguilar, na Espanha do século XV. Callum descobre que é descendente de uma misteriosa sociedade secreta, os Assassinos, e acumula conhecimentos e habilidades incríveis para enfrentar a organização opressiva e poderosa dos Templários nos dias de hoje.","first_air_date":"2016-12-21","runtime":116,"episode_run_time":[116],"vote_average":5.4,"created_by":["New Regency Pictures","The Kennedy/Marshall Company","Ubisoft Film & Television","DMC Film"],"production_companies":[{"name":"New Regency Pictures"},{"name":"The Kennedy/Marshall Company"},{"name":"Ubisoft Film & Television"},{"name":"DMC Film"}],"cast":["Michael Fassbender","Marion Cotillard","Jeremy Irons","Brendan Gleeson","Charlotte Rampling"],"backdrop_path":"https://image.tmdb.org/t/p/original/e29oMyfzzlWbhRlCBrzmZhlsw2m.jpg","poster_path":"https://image.tmdb.org/t/p/original/1Cxn5MxH3dDBXauIq6XusR1ZUKJ.jpg","certification":"12","genres":["Ação","Aventura","Ficção científica"],"trailer":"jTgzJ79KDsg"},
"58428":{"id":"58428","name":"Hotel da Morte","slug":"hotel-da-morte","original_title":"The Innkeepers","overview":"Uma dupla de funcionários de um hotel, nos seus últimos dias de aviso prévio e prestes a mudar de emprego, decidem descobrir os segredos tenebrosos que eles têm certeza que o hotel esconde. No entanto, sua missão começa a se tornar perigosa quando antigos hóspedes retornam para passar uma última temporada no hotel.","first_air_date":"2011-08-18","runtime":101,"episode_run_time":[101],"vote_average":5.4,"created_by":["Dark Sky Films","Glass Eye Pix"],"production_companies":[{"name":"Dark Sky Films"},{"name":"Glass Eye Pix"}],"cast":["Sara Paxton","Pat Healy","Kelly McGillis","George Riddle","Lena Dunham"],"backdrop_path":"https://image.tmdb.org/t/p/original/lPBXvtVZszCnuArfbnFMe735gwO.jpg","poster_path":"https://image.tmdb.org/t/p/original/kyIYAZvx9OPmEniNLPIkGlmkM3D.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
"66129":{"id":"66129","name":"A Família Tuche","slug":"a-familia-tuche","original_title":"Les Tuche","overview":"Em Bouzolles, todos conhecem a família Tuche. Adeptos da filosofia de que “o homem não foi feito para trabalhar”, Jeff, Cathy e seus três filhos vivem felizes com pouco dinheiro, se sustentando com um seguro-desemprego. Quando descobrem que ganharam 100 milhões de euros na loteria, porém, essa realidade muda radicalmente. Os Tuche tornam-se riquíssimos e decidem, logicamente, se mudar para Mônaco, onde Cathy sempre sonhou morar. A família precisará mudar seus hábitos para se integrar a uma nova pátria e cultura, mas não às custas de sua essência.","first_air_date":"2011-06-30","runtime":95,"episode_run_time":[95],"vote_average":6.0,"created_by":["Pathé Distribution","Eskwad","Serenity Films","Groupe TF1"],"production_companies":[{"name":"Pathé Distribution"},{"name":"Eskwad"},{"name":"Serenity Films"},{"name":"Groupe TF1"}],"cast":["Jean-Paul Rouve","Isabelle Nanty","Claire Nadeau","Théo Fernandez","Sarah Stern"],"backdrop_path":"https://image.tmdb.org/t/p/original/odKJ6zy27UmGE398U2K9PlLqnZY.jpg","poster_path":"https://image.tmdb.org/t/p/original/Ajc0RKYqU6Lh0tqrSucP0oPNait.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"6075":{"id":"6075","name":"O Pagamento Final","slug":"o-pagamento-final","original_title":"Carlito's Way","overview":"Após sair da prisão, Carlito Brigante jura a si mesmo que nunca mais vai voltar a viver como no passado. A mudança de vida não é fácil, uma vez que ele precisa resistir a várias oportunidades e tentações para voltar a lidar com o tráfico de heroína. Ele encontra seu antigo amor, Gail, que lhe mostra que a vida pode ser feliz. Carlito começa a economizar dinheiro para se mudar para as Bahamas, mas nem tudo sai como o esperado.","first_air_date":"1993-11-10","runtime":144,"episode_run_time":[144],"vote_average":7.8,"created_by":["Universal Pictures","Epic Productions","Bregman/Baer Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Epic Productions"},{"name":"Bregman/Baer Productions"}],"cast":["Al Pacino","Sean Penn","Penelope Ann Miller","John Leguizamo","Ingrid Rogers"],"backdrop_path":"https://image.tmdb.org/t/p/original/38yjZWYBI0xxNqoBKiGyA4UZjk.jpg","poster_path":"https://image.tmdb.org/t/p/original/8ZjkyLm45AjkSeu6pzXBcrdqJI4.jpg","certification":"14","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
