"10537":{"id":"10537","name":"The Doors","slug":"the-doors","original_title":"The Doors","overview":"Jim Morrison, a voz e a alma da banda The Doors, um homem que marcou várias gerações e que ainda hoje nos faz interrogar se algum dia alguém o conheceu realmente. Oliver Stone, realizador pródigo em filmar polêmicas americanas, realizou em 1991 um filme sobre a ascensão da banda, terminando o filme com a morte de Jim Morrison, cuja frase do epílogo deixa a certeza das causas em aberto (dizem que Jim morreu de uma parada cardíaca). É, em seus certos exageros, a biografia de Jim Morrison e da banda The Doors, uma das mais influentes dos anos 1960. Mostra sua passagem pelo conturbado mundo do rock'n'roll, onde as drogas e o sexo reinavam.","first_air_date":"1991-03-01","runtime":140,"episode_run_time":[140],"vote_average":7.1,"created_by":["Carolco Pictures","Bill Graham Films","Imagine Entertainment","Ixtlan"],"production_companies":[{"name":"Carolco Pictures"},{"name":"Bill Graham Films"},{"name":"Imagine Entertainment"},{"name":"Ixtlan"}],"cast":["Val Kilmer","Meg Ryan","Kyle MacLachlan","Frank Whaley","Kevin Dillon"],"backdrop_path":"https://image.tmdb.org/t/p/original/xnWZtdNW0QrCSIQobIn9owWUJ6j.jpg","poster_path":"https://image.tmdb.org/t/p/original/x1LM3dzGuG6xOz0aT2e71o11vhu.jpg","certification":"18","genres":["Música","Drama","História"],"trailer":"N/A"},
"42297":{"id":"42297","name":"Burlesque","slug":"burlesque","original_title":"Burlesque","overview":"Ali (Christina Aguilera) deixou sua pequena cidade natal em busca do sucesso em Los Angeles. Logo ao chegar ela conhece a boate Burlesque, especializada em shows musicais de belas mulheres, que sempre se apresentam usando playback. O local é gerenciado por Tess (Cher), que nega uma chance a Ali. Ela insiste e consegue ser contratada como garçonete, graças à ajuda do balconista Jack (Cam Gigandet). Ali passa a acompanhar todos os shows, decorando as canções e coreografias. Quando Tess e seu braço-direito Sean (Stanley Tucci) realizam uma audição em busca de novas bailarinas, Ali aproveita a chance para mostrar do que é capaz.","first_air_date":"2010-11-23","runtime":119,"episode_run_time":[119],"vote_average":7.2,"created_by":["Screen Gems","Bedford Falls Productions"],"production_companies":[{"name":"Screen Gems"},{"name":"Bedford Falls Productions"}],"cast":["Cher","Christina Aguilera","Cam Gigandet","Kristen Bell","Stanley Tucci"],"backdrop_path":"https://image.tmdb.org/t/p/original/56H7AtJ5GK4UxFoHuw9QDwI7wzD.jpg","poster_path":"https://image.tmdb.org/t/p/original/oCTvLdp6YDmKl525uk6qlJUiViS.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
