"10603":{"id":"10603","name":"George, o Rei da Floresta","slug":"george-o-rei-da-floresta","original_title":"George of the Jungle","overview":"Grupo de gorilas adota criança abandonada na selva após acidente com seus pais. Apesar de ser totalmente atrapalhado, o garoto cresce e torna-se o rei dos animais, levando uma vida calma e monótona, até conhecer a linda Úrsula, a primeira mulher de carne e osso que vê em sua vida. Apaixona-se imediatamente, e resolve acompanhá-la até São Francisco, para aprender os costumes e a cultura do homem branco. Pronto! A confusão está armada.","first_air_date":"1997-07-15","runtime":92,"episode_run_time":[92],"vote_average":5.6,"created_by":["Mandeville Films","Walt Disney Pictures"],"production_companies":[{"name":"Mandeville Films"},{"name":"Walt Disney Pictures"}],"cast":["Brendan Fraser","Leslie Mann","Thomas Haden Church","John Cleese","Richard Roundtree"],"backdrop_path":"https://image.tmdb.org/t/p/original/eUNb2wpcvSHYLcGHU2afd31dvGi.jpg","poster_path":"https://image.tmdb.org/t/p/original/txoCXWx2X582EXfSpiwBGio2QDa.jpg","certification":"N/A","genres":["Aventura","Comédia","Família","Romance"],"trailer":"N/A"},
