"10016":{"id":"10016","name":"Fantasmas de Marte","slug":"fantasmas-de-marte","original_title":"Ghosts of Mars","overview":"Natasha Hestrindge é Melaine Bellard, uma tenente policial escalda para trabalhar em Marte no ano de 2025. Humanos vêm colonizando e minerando o planeta vermelho já há algum tempo, mas quando Bellard e seu esquadrão são enviados a uma região remota para prender um perigoso criminoso descobrem que ele é o menor dos seus problemas. A mineração despertou um exército mortal de espíritos marcianos que tomam os corpos dos humanos e estão determinados a destruir todos os invasores de seu planeta.","first_air_date":"2001-08-24","runtime":98,"episode_run_time":[98],"vote_average":5.1,"created_by":["Animationwerks","Screen Gems","Storm King Productions"],"production_companies":[{"name":"Animationwerks"},{"name":"Screen Gems"},{"name":"Storm King Productions"}],"cast":["Natasha Henstridge","Ice Cube","Pam Grier","Jason Statham","Clea DuVall"],"backdrop_path":"https://image.tmdb.org/t/p/original/anSbunnEMI0TSmizqUSRACoe18l.jpg","poster_path":"https://image.tmdb.org/t/p/original/35Bg0I2aTB1j3Ugcw02y9T5nTQx.jpg","certification":"16","genres":["Ação","Terror","Ficção científica"],"trailer":"N/A"},
"60307":{"id":"60307","name":"Diário de um Banana 2: Rodrick é o Cara","slug":"diario-de-um-banana-2-rodrick-e-o-cara","original_title":"Diary of a Wimpy Kid: Rodrick Rules","overview":"Greg Heffley está de volta, agora cursando a sétima série do ensino fundamental. Além dos valentões da escola, desta vez Greg terá de enfrentar o irmão mais velho, Rodrick, que descobre um segredo do caçula da família por meio do diário. Como Greg não quer que a descoberta seja espalhada, Rodrick aproveita que está no controle da situação para atormentar o irmão mais novo.","first_air_date":"2011-03-25","runtime":99,"episode_run_time":[99],"vote_average":6.6,"created_by":["Color Force","Dune Entertainment","Fox 2000 Pictures"],"production_companies":[{"name":"Color Force"},{"name":"Dune Entertainment"},{"name":"Fox 2000 Pictures"}],"cast":["Zachary Gordon","Devon Bostick","Robert Capron","Steve Zahn","Rachael Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/9BwGL0nsjCdvhe6V9q42NG11Pyq.jpg","poster_path":"https://image.tmdb.org/t/p/original/8oG3apBrzi3Q5C3Z2jNM61tyCW6.jpg","certification":"N/A","genres":["Família","Comédia"],"trailer":"N/A"},
"298":{"id":"298","name":"Treze Homens e um Novo Segredo","slug":"treze-homens-e-um-novo-segredo","original_title":"Ocean's Thirteen","overview":"Reuben Tischkoff, o homem que bancou financeiramente o assalto triplo aos cassinos de Terry Benedict, foi traído por Willie Bank, um inescrupuloso dono de cassinos. Com Reuben no hospital, Danny Ocean, Rusty Ryan e sua trupe mais uma vez se reúnem para iniciar um plano de vingança. O objetivo é derrotar Bank na noite de inauguração de seu mais luxuoso cassino, chamado The Bank, derrotando-o financeiramente e também atingindo sua reputação.","first_air_date":"2007-06-05","runtime":122,"episode_run_time":[122],"vote_average":6.7,"created_by":["Warner Bros. Pictures","Village Roadshow Pictures","Jerry Weintraub Productions","Section Eight"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Village Roadshow Pictures"},{"name":"Jerry Weintraub Productions"},{"name":"Section Eight"}],"cast":["George Clooney","Brad Pitt","Matt Damon","Andy García","Don Cheadle"],"backdrop_path":"https://image.tmdb.org/t/p/original/f4WzxA4jiYaSKO2Zw07JEYmYFVo.jpg","poster_path":"https://image.tmdb.org/t/p/original/hWmFe0A26TNmnfHrHdmKmN0N6QZ.jpg","certification":"10","genres":["Crime","Thriller"],"trailer":"N/A"},
"205775":{"id":"205775","name":"No Coração do Mar","slug":"no-coracao-do-mar","original_title":"In the Heart of the Sea","overview":"No inverno de 1820, Essex, um navio baleeiro de Nova Inglaterra, foi atacado por algo inacreditável: uma baleia com um tamanho e determinação gigantescas e um sentido de vingança praticamente humano. Adaptação da obra de Nathaniel Philbrick, este filme narra as lancinantes consequências deste terrível encontro, com a tripulação a ser levada ao seu limite e forçada a fazer o impensável para sobreviver. Enfrentando tempestades, fome, pânico e o desespero, os homens vão colocar em causa a suas crenças mais profundas, desde o valor real das suas vidas à moralidade do seu ofício, enquanto o capitão procura uma saída no mar imenso e o imediato Owen Chase, uma maneira de destruir a gigantesca baleia.","first_air_date":"2015-12-03","runtime":122,"episode_run_time":[122],"vote_average":6.8,"created_by":["Imagine Entertainment","Spring Creek Pictures","Roth Films","Kjam Media","Cott Productions","Surf Film","Enelmar Productions, A.I.E.","Warner Bros. Pictures","Village Roadshow Pictures"],"production_companies":[{"name":"Imagine Entertainment"},{"name":"Spring Creek Pictures"},{"name":"Roth Films"},{"name":"Kjam Media"},{"name":"Cott Productions"},{"name":"Surf Film"},{"name":"Enelmar Productions, A.I.E."},{"name":"Warner Bros. Pictures"},{"name":"Village Roadshow Pictures"}],"cast":["Chris Hemsworth","Benjamin Walker","Cillian Murphy","Brendan Gleeson","Ben Whishaw"],"backdrop_path":"https://image.tmdb.org/t/p/original/xnuy6CYEoBmXKhTjKDSbzLe1dB5.jpg","poster_path":"https://image.tmdb.org/t/p/original/v0f6zLv2TwhscRFDRnbcw8McBeI.jpg","certification":"14","genres":["Thriller","Drama","Aventura","Ação","História"],"trailer":"N/A"},
