"10281":{"id":"10281","name":"Sexta-Feira 13 - Parte 7: A Matança Continua","slug":"sexta-feira-13-parte-7-a-matanca-continua","original_title":"Friday the 13th Part VII: The New Blood","overview":"Tina Shepard é uma adolescente com poderes telecinéticos descontrolados. Quando menina tirava férias no acampamento Crystal Lake, ela matou seu abusivo pai com o uso das suas habilidades mentais, quando teve um acesso de raiva. Anos depois, ao se aconselhar com Crews, um psicólogo manipulador e ambicioso, Tina concorda em participar de uma terapia radical que a leva de volta à Crystal Lake. Infelizmente, as habilidades psíquicas de Tina despertam Jason Voorhees, que estava sepultado no fundo do lago, o que faz com que o vingativo Jason elimine vários adolescentes de uma casa próxima de forma sangrenta. Assim, Tina tenta deter o massacre de Jason usando seus poderes.","first_air_date":"1988-05-13","runtime":88,"episode_run_time":[88],"vote_average":5.5,"created_by":["Friday Four Films Inc.","Sean S. Cunningham Films"],"production_companies":[{"name":"Friday Four Films Inc."},{"name":"Sean S. Cunningham Films"}],"cast":["Lar Park Lincoln","Kane Hodder","Terry Kiser","Kevin Spirtas","Susan Jennifer Sullivan"],"backdrop_path":"https://image.tmdb.org/t/p/original/roHX6N0VkySKBlramHUw1zdMQHB.jpg","poster_path":"https://image.tmdb.org/t/p/original/jZtAGb27TYrhva4Cb5Cw6AWI0Cv.jpg","certification":"18","genres":["Terror","Thriller"],"trailer":"N/A"},
"419478":{"id":"419478","name":"Sol da Meia-noite","slug":"sol-da-meia-noite","original_title":"Midnight Sun","overview":"Katie (Bella Thorne) é uma jovem de 17 anos que vive protegida dentro de sua casa desde a sua infância. Confinada no local durante os dias, ela possui uma rara doença que faz com que a menor quantidade de luz solar seja mortal. Sua situação muda quando seu destino se cruza com o de Charlie (Patrick Schwarzenegger) e eles iniciam um romance de verão.","first_air_date":"2018-03-22","runtime":91,"episode_run_time":[91],"vote_average":7.8,"created_by":["Boies/Schiller Film Group","Wrigley Pictures","Universal Pictures"],"production_companies":[{"name":"Boies/Schiller Film Group"},{"name":"Wrigley Pictures"},{"name":"Universal Pictures"}],"cast":["Bella Thorne","Patrick Schwarzenegger","Rob Riggle","Quinn Shephard","Ken Tremblett"],"backdrop_path":"https://image.tmdb.org/t/p/original/9T8sj5io4SGCBTHsk5H8LGcfKVe.jpg","poster_path":"https://image.tmdb.org/t/p/original/1x8tN7XMxWgnJQnjZRxwMeiEWtF.jpg","certification":"12","genres":["Romance","Drama"],"trailer":"bc1WWuC8WiE"},
