"424998":{"id":"424998","name":"Em Defesa de Cristo","slug":"em-defesa-de-cristo","original_title":"The Case for Christ","overview":"Lee Strobel, um jornalista conservador e linha dura, vivendo os melhores dias de sua carreira: uma premiada reportagem acaba de lhe render uma promoção para editor jurídico no jornal Chicago Tribune. Mas, seu casamento não ia muito bem. Sua esposa, Leslie, se converte à fé cristã indo contra tudo que Lee pensa, como um ateu convicto, a respeito da religião. Utilizando sua vasta experiência com as leis e em jornalismo, Lee começa uma jornada para rebater os argumentos do Cristianismo para poder salvar seu casamento. Investigando a maior história de sua carreira, Lee se vê cara a cara com fatos inesperados que podem mudar tudo que ele acredita ser verdade.","first_air_date":"2017-04-07","runtime":112,"episode_run_time":[112],"vote_average":6.8,"created_by":["Pure Flix Entertainment","Triple Horse Studios","Entertainment Studios Motion Pictures"],"production_companies":[{"name":"Pure Flix Entertainment"},{"name":"Triple Horse Studios"},{"name":"Entertainment Studios Motion Pictures"}],"cast":["Mike Vogel","Erika Christensen","Faye Dunaway","Robert Forster","Frankie Faison"],"backdrop_path":"https://image.tmdb.org/t/p/original/4KBjtJvuK8Zg8fTDrXHfE4JpLXY.jpg","poster_path":"https://image.tmdb.org/t/p/original/pyxN3LztDtPus5JSOv1HiRHkSco.jpg","certification":"12","genres":["Drama"],"trailer":"0EFppdsg-LQ"},
