"1386628":{"id":"1386628","name":"Avante: Nos Bastidores de Deadpool & Wolverine","slug":"avante-nos-bastidores-de-deadpool-wolverine","original_title":"Marvel Studios Assembled: The Making of Deadpool & Wolverine","overview":"Quando foi anunciado que Deadpool estava oficialmente entrando para o MCU, muitos pensaram só uma coisa: Finalmente! O mercenário tagarela vai ter seu próprio episódio de Avante! E agora, queridos amigos, aqui está ele, rcom um excesso de palavrões e violência, exatamente como o Todo Poderoso queria. Ah, e não fiquem nervosos. Não esquecemos do Wolverine. Sua majestade mal-humorada está totalmente presente.","first_air_date":"2024-11-12","runtime":59,"episode_run_time":[59],"vote_average":6.8,"created_by":["Marvel Studios","M3 Creative"],"production_companies":[{"name":"Marvel Studios"},{"name":"M3 Creative"}],"cast":["Shawn Levy","Ryan Reynolds","Kevin Feige","Hugh Jackman","Wendy Jacobson"],"backdrop_path":"https://image.tmdb.org/t/p/original/j47pXLSYWFY1CJAZrBD7vhwGo0q.jpg","poster_path":"https://image.tmdb.org/t/p/original/nOUTzkvpE62wZJ9ANM0oEdAhSZG.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
