"49017":{"id":"49017","name":"Dracula: A História Nunca Contada","slug":"dracula-a-historia-nunca-contada","original_title":"Dracula Untold","overview":"Os habitantes da Transilvânia sempre foram inimigos dos turcos, com quem tiveram batalhas épicas. Para evitar que sua população fosse massacrada, o rei local aceitou entregar aos turcos centenas de crianças. Entre elas estava seu próprio filho, Vlad Tepes (Luke Evans), que aprendeu com os turcos a arte de guerrear. Logo Vlad ganhou fama pela ferocidade nas batalhas e também por empalar os derrotados. De volta à Transilvânia, onde é nomeado príncipe, ele governa em paz por 10 anos. Só que o rei Mehmed (Dominic Cooper) mais uma vez exige que 100 crianças sejam entregues aos turcos. Vlad se recusa e, com isso, inicia uma nova guerra. Para vencê-la, ele recorre a um ser das trevas (Charles Dance) que vive pela região. Após beber o sangue dele, Vlad se torna um vampiro e ganha poderes sobrehumanos.","first_air_date":"2014-10-01","runtime":92,"episode_run_time":[92],"vote_average":6.4,"created_by":["Universal Pictures","Legendary Pictures","Michael De Luca Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Legendary Pictures"},{"name":"Michael De Luca Productions"}],"cast":["Luke Evans","Sarah Gadon","Dominic Cooper","Art Parkinson","Charles Dance"],"backdrop_path":"https://image.tmdb.org/t/p/original/f02FFv77Rh62633YEjimv7C6JM3.jpg","poster_path":"https://image.tmdb.org/t/p/original/t8bA9xbOtqRaR8KwvzWlWwbvZvI.jpg","certification":"14","genres":["Terror","Ação","Fantasia"],"trailer":"UBd_x0KOCFU"},
"100241":{"id":"100241","name":"Frankenstein: Entre Anjos e Demônios","slug":"frankenstein-entre-anjos-e-demonios","original_title":"I, Frankenstein","overview":"Após enterrar o Dr. Victor Frankenstein, o monstro criado por ele é atacado por demônios, que pretendem capturá-lo. Ele consegue se salvar e segue sua vida. Porém, 200 anos depois, o monstro, agora com o nome de Adam, acaba se envolvendo em uma guerra entre dois clãs imortais na cidade ancestral de Darkhaven.","first_air_date":"2014-01-22","runtime":92,"episode_run_time":[92],"vote_average":5.4,"created_by":["Lionsgate","Lakeshore Entertainment","Sidney Kimmel Entertainment","Hopscotch Features"],"production_companies":[{"name":"Lionsgate"},{"name":"Lakeshore Entertainment"},{"name":"Sidney Kimmel Entertainment"},{"name":"Hopscotch Features"}],"cast":["Aaron Eckhart","Yvonne Strahovski","Bill Nighy","Jai Courtney","Miranda Otto"],"backdrop_path":"https://image.tmdb.org/t/p/original/y1W70TgfOeaX14xoDxfaiHutA3X.jpg","poster_path":"https://image.tmdb.org/t/p/original/yzhhMRxXimA3ODrDI18an61tcIy.jpg","certification":"12","genres":["Terror","Thriller"],"trailer":"N/A"},
"14462":{"id":"14462","name":"Sob o Domínio do Mal","slug":"sob-o-dominio-do-mal","original_title":"The Manchurian Candidate","overview":"Ben Marco é um soldado que, em meio a Guerra do Golfo, é sequestrado pelo inimigo, juntamente com sua tropa. Alguns anos depois, já em sua casa, Ben começa a se lembrar do processo de lavagem cerebral pelo qual passou enquanto esteve preso, que fazia com que obedecesse ordens sem contestá-las. Com um de seus companheiros de tropa, Raymond Shaw, agora concorrendo a um cargo na vida política do país, Ben tenta entrar em contato com ele, temendo que ele esteja sendo controlado neste exato momento.","first_air_date":"2004-07-30","runtime":129,"episode_run_time":[129],"vote_average":6.5,"created_by":["Clinica Estetico","Paramount Pictures","Scott Rudin Productions","Tina Sinatra Productions"],"production_companies":[{"name":"Clinica Estetico"},{"name":"Paramount Pictures"},{"name":"Scott Rudin Productions"},{"name":"Tina Sinatra Productions"}],"cast":["Denzel Washington","Meryl Streep","Liev Schreiber","Simon McBurney","Kimberly Elise"],"backdrop_path":"https://image.tmdb.org/t/p/original/266RMJ7qurwYgnKmy8zuWN81e2D.jpg","poster_path":"https://image.tmdb.org/t/p/original/2un9WXrDwhcsyhu5Y5VreyFz9Ot.jpg","certification":"N/A","genres":["Drama","Thriller","Mistério"],"trailer":"N/A"},
"431":{"id":"431","name":"Cubo","slug":"cubo","original_title":"Cube","overview":"Um policial , um ladrão, uma matemática, uma psicóloga, um arquiteto e um jovem autista são misteriosamente presos em um labirinto de alta tecnologia. Sem comida nem água, eles precisam encontrar um meio de sair do local. Mas precisam também tomar cuidado para não acionar armadilhas letais, que surgem em estranhos cubos.","first_air_date":"1997-12-10","runtime":90,"episode_run_time":[90],"vote_average":6.8,"created_by":["Cube Libre","The Feature Film Project"],"production_companies":[{"name":"Cube Libre"},{"name":"The Feature Film Project"}],"cast":["Nicole de Boer","Nicky Guadagni","Maurice Dean Wint","David Hewlett","Andrew Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/3TimUBrXMVblpnTsyg4HssGVbBv.jpg","poster_path":"https://image.tmdb.org/t/p/original/ffgfJUxCiNm8NKaCQ7Jzsqx8IMs.jpg","certification":"N/A","genres":["Thriller","Ficção científica","Mistério"],"trailer":"N/A"},
