"239678":{"id":"239678","name":"Sete Dias Sem Fim","slug":"sete-dias-sem-fim","original_title":"This Is Where I Leave You","overview":"Os membros de uma família judia nunca seguiram realmente as tradições religiosas, mas, quando o pai morre, os quatro filhos, que não se encontravam há décadas, aceitam fazer a cerimônia do Shivah juntos. Passando uma semana inteira dentro da casa da infância junto da mãe fofoqueira e vários cônjugues, problemas familiares vêm à tona.","first_air_date":"2014-09-10","runtime":103,"episode_run_time":[103],"vote_average":6.6,"created_by":["Spring Creek Pictures","21 Laps Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"Spring Creek Pictures"},{"name":"21 Laps Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Jason Bateman","Tina Fey","Jane Fonda","Adam Driver","Rose Byrne"],"backdrop_path":"https://image.tmdb.org/t/p/original/njK3bfEYuqwjs8YTkpaDtkoTmVr.jpg","poster_path":"https://image.tmdb.org/t/p/original/qDxWCy3bpDcxskGNCWWstSawRzB.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"8054":{"id":"8054","name":"O Mundo Imaginário do Dr. Parnassus","slug":"o-mundo-imaginario-do-dr-parnassus","original_title":"The Imaginarium of Doctor Parnassus","overview":"O Doutor Parnassus, líder de um espetáculo artístico, tem um obscuro segredo: há muitos anos, ele trocou a alma de sua filha com o diabo. Agora o diabo voltou para cobrar o acordo, e Dr. Parnassus terá que coletar cinco almas para salvar a jovem.","first_air_date":"2009-10-01","runtime":123,"episode_run_time":[123],"vote_average":6.4,"created_by":["Infinity Features","Davis Films","Poo Poo Pictures"],"production_companies":[{"name":"Infinity Features"},{"name":"Davis Films"},{"name":"Poo Poo Pictures"}],"cast":["Christopher Plummer","Lily Cole","Heath Ledger","Andrew Garfield","Verne Troyer"],"backdrop_path":"https://image.tmdb.org/t/p/original/vBw4z7l3NI32th7nR34zqRgdvXS.jpg","poster_path":"https://image.tmdb.org/t/p/original/hf85C8N2sHZFh6PtX1MWD6t06Js.jpg","certification":"14","genres":["Aventura","Fantasia","Mistério"],"trailer":"6yI9qELW6KM"},
"11811":{"id":"11811","name":"O Duende","slug":"o-duende","original_title":"Leprechaun","overview":"Um duende inglês, Leprechaun (Warwick Davis) assassina todos que tentam aproximar-se do seu ouro. Quando está prestes a matá-lo, após o aprisionar e capturar seu tesouro, Dan O'Grady (Shay Duffin) sofre um derrame e é internado. A casa de O'Grady é vendida a J.D. (John Sanderford) e sua filha Tory (Jennifer Aniston). Quando a jovem e os amigos libertam sem querer o duende, ele espalha o caos pela cidade. A fim de aprisioná-lo e consequentemente o matar, o grupo vai atrás do Sr. O'Grady para saber como realizar tal procedimento.","first_air_date":"1993-01-08","runtime":91,"episode_run_time":[91],"vote_average":5.6,"created_by":["Trimark Pictures"],"production_companies":[{"name":"Trimark Pictures"}],"cast":["Warwick Davis","Jennifer Aniston","Ken Olandt","Mark Holton","Robert Hy Gorman"],"backdrop_path":"https://image.tmdb.org/t/p/original/gD49F7FL8Uou45wVXx9zEz4QYKm.jpg","poster_path":"https://image.tmdb.org/t/p/original/h7OPiAEyp2arKrKnQPL3EByo74D.jpg","certification":"12","genres":["Terror","Comédia","Fantasia"],"trailer":"N/A"},
