"9798":{"id":"9798","name":"Inimigo do Estado","slug":"inimigo-do-estado","original_title":"Enemy of the State","overview":"Robert Clayton Dean, um advogado bem-sucedido em Washington, recebe um vídeo que mostra a ligação entre um oficial do alto escalão da Agência Nacional de Segurança a um assassinato político. A partir daí, Dean se transforma em um alvo constante para a mais perigosa e treinada equipe do governo. Utilizando todos os meios para arruinar sua carreira e conseguir o vídeo de volta, a equipe inicia uma caçada sem tréguas. Dean terá de lutar para salvar sua vida e provar sua inocência.","first_air_date":"1998-11-20","runtime":132,"episode_run_time":[132],"vote_average":7.1,"created_by":["Touchstone Pictures","Jerry Bruckheimer Films","Scott Free Productions"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Jerry Bruckheimer Films"},{"name":"Scott Free Productions"}],"cast":["Will Smith","Gene Hackman","Jon Voight","Regina King","Loren Dean"],"backdrop_path":"https://image.tmdb.org/t/p/original/lPLTLCBn39Wiy1RPQLB9xOKyF2v.jpg","poster_path":"https://image.tmdb.org/t/p/original/eRIi2QdEaG5UgguUALg8AiWX8Uh.jpg","certification":"14","genres":["Ação","Drama","Thriller"],"trailer":"N/A"},
