"8914":{"id":"8914","name":"Do Fundo do Mar","slug":"do-fundo-do-mar","original_title":"Deep Blue Sea","overview":"A Dra. Susan McAlester está fazendo pesquisa com tubarões, pois pretende através deles descobrir a cura para o Mal de Alzheimer. Russell Franklin, um empresário, é o principal patrocinador e doou 200 milhões de dólares para o projeto. Quando um tubarão escapa e ataca um barco, a reação de Russell não é boa, mas Susan consegue reverter a situação e ele decide visitar Aquática, uma antiga base de submarinos no meio do oceano agora convertida em laboratório. Neste local Susan faz alterações genéticas nos tubarões, deixando-os mais inteligentes, para que sua experiência seja bem sucedida. O problema é que os animais se tornam também mais rápidos e não sentem vontade de colaborar, pois anseiam ir para mar aberto.","first_air_date":"1999-07-28","runtime":108,"episode_run_time":[108],"vote_average":6.0,"created_by":["Riche-Ludwig Productions","Village Roadshow Pictures","Groucho III Film Partnership","Warner Bros. Pictures"],"production_companies":[{"name":"Riche-Ludwig Productions"},{"name":"Village Roadshow Pictures"},{"name":"Groucho III Film Partnership"},{"name":"Warner Bros. Pictures"}],"cast":["Thomas Jane","Saffron Burrows","Samuel L. Jackson","Jacqueline McKenzie","Michael Rapaport"],"backdrop_path":"https://image.tmdb.org/t/p/original/d8TIyaOwqrzWWxERxQ9fJ9jrFrb.jpg","poster_path":"https://image.tmdb.org/t/p/original/gbDNaZJt9bqEaDB6OU3aYEskj72.jpg","certification":"N/A","genres":["Ação","Terror","Ficção científica"],"trailer":"N/A"},
