"10578":{"id":"10578","name":"Drácula 2 - A Ascensão 2003","slug":"dracula-2-a-ascensao-2003","original_title":"Dracula II: Ascension","overview":"Drácula não morreu. Depois de ficar anos desaparecido, o Príncipe das Trevas retorna em mais um filme de terror arrepiante. Um corpo totalmente carbonizado chega ao necrotério. Ao começar a autópsia, a Dra. Elizabeth nota que está de frente para um corpo completamente sem sangue. Inicia-se uma série de experiências que despertam o vampiro enfurecido e sedento. Ele quer secar as veias daquele grupo de homens e mulheres, mas Drácula não sabe que o padre Uffizi está à sua procura. Conhecido caçador de vampiros, ele não descansará enquanto não eliminar mais este sanguessuga. Uma luta desesperada está para começar..","first_air_date":"2003-06-07","runtime":85,"episode_run_time":[85],"vote_average":5.7,"created_by":["Dimension Films","Castel Film"],"production_companies":[{"name":"Dimension Films"},{"name":"Castel Film"}],"cast":["Stephen Billington","Craig Sheffer","Jason Scott Lee","Jason London","Diane Neal"],"backdrop_path":"https://image.tmdb.org/t/p/original/o3qmCr5eKRoWw43z6U00JaeVgxa.jpg","poster_path":"https://image.tmdb.org/t/p/original/ngomDZt13JdOFjdJIisSCyLqwXh.jpg","certification":"N/A","genres":["Terror","Thriller","Fantasia"],"trailer":"N/A"},
